""" 
This module contains functions to download student major data from the 
California Community Colleges Chancellor's Office (CCCCO) DataMart. This is a 
centralized repository of aggregated data that the California Community Colleges
report to the CCCCO after each academic period.

Author: EM
"""

import lxml.html as lx
import pandas as pd
import requests
import time


def get_majors(page: int) -> pd.DataFrame:
    """ 
    This function sets us up to cycle through pages. Within the payload,
    "callnumber" changed by one number per page, so using that allows to
    extract data one page at a time.
    """

    call_number = f"c0:P|PN{page}"
    viewstate, viewstategen, event_val = _get_viewstate()

    response_top_four = requests.post(
        "https://datamart.cccco.edu/Outcomes/Program_Awards.aspx",
        data=_get_payload(call_number, viewstate, viewstategen, event_val),
        cookies=_get_cookies_majors(),
        headers=_get_headers(),
    )

    modify_text4 = response_top_four.text

    # Dr. Kramlinger helped me to understand the need to remove script, so xpath
    # could work and detect the data.
    modify_text4 = modify_text4.replace('<script', '').replace('<\\/script', '')

    html = lx.fromstring(modify_text4)

    # Calling by the table created some issues with text extraction
    # Calling by the td itself allowed for data collection
    rows = html.xpath("//tr[td[contains(@class, 'dxpgCell_Aqua')]]")

    # Then I get the majors and total per college row names, which requires
    # flexibility since some tr have two td and need specific one.
    coulumn_two = [
        td.strip()
        for td in html.xpath(
            ".//td[contains(@class, 'dx-nowrap lastLevel')]/text()"
        )
    ]

    table_info = []

    # Here I am collecting the data for the table and needing to add in 0
    for row in rows:
        row_content = [
            (
                td.text_content().strip().replace("\xa0", "0")
                if td.text_content().strip()
                else "0"
            )
            for td in row.xpath(".//td[contains(@class, 'dxpgCell_Aqua')]")
        ]
        table_info.append(row_content)
    Majors_data = pd.DataFrame(table_info)
    Majors_data.insert(0, "Major or Total Awards", coulumn_two)


def get_all_majors() -> pd.DataFrame:
    """
    This function will cycle through all pages of the Majors data and return
    a pandas DataFrame with all the data.
    """

    all_majors = []
    for page in range(207):
        majors_info = get_majors(page)
        all_majors = all_majors.append(majors_info)
        time.sleep(0.5)
    return pd.concat(all_majors)


def get_modified_majors(filename: str = "majors") -> pd.DataFrame:
    """
    This function will cycle through all pages of the Majors data, extract the
    college name, and perform routine data transformations to return a pandas
    DataFrame with the modified data. Saves the file to the specified filename.
    """

    major_modified = get_all_majors()
    major_modified["College"] = major_modified["Major or Total Awards"].where(
        major_modified["Major or Total Awards"].str.contains("Total")
    )
    major_modified["College"] = major_modified["College"].ffill()
    major_modified = major_modified[
        ~major_modified["Major or Total Awards"].str.contains("Total")
    ]
    major_modified["College"] = (
        major_modified["College"].str.replace("Total", "")
    )
    college = major_modified.pop("College")
    major_modified.insert(0, "College", college)

    headers = [
        "College",
        "Major",
        "2014-2015",
        "2015-2016",
        "2016-2017",
        "2017-2018",
        "2018-2019",
        "2019-2020",
        "2020-2021",
        "2021-2022",
        "2022-2023",
        "2023-2024",
    ]

    major_modified.columns = headers
    major_modified.to_csv(f"./data/{filename}.csv", index=False)
    return major_modified


# Necessary payload parameters for the post request. Since this is an ASPX web
# form, the payload is enormous.
def _get_viewstate() -> tuple:
    headers={
        "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/133.0.0.0 Safari/537.36",
        "Accept": "text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.7"
    }

    response = requests.get("https://datamart.cccco.edu/Outcomes/Program_Awards.aspx", headers=headers)
    result = response.text
    html = lx.fromstring(result)
    return (
        html.xpath('//input[@name="__VIEWSTATE"]/@value'),
        html.xpath('//input[@name="__VIEWSTATEGENERATOR"]/@value'),
        html.xpath('//input[@name="__EVENTVALIDATION"]/@value')
    )


